import React from 'react';
import s from './BigProjects.module.css';
import yerevan from '../../assets/images/yerevan.jpg';
import avto from '../../assets/images/avto.jpg';
import itworld from '../../assets/images/itworld.am.png'

const BigProjectCart = (props) => {

    return (
        <div className={s.cart}>
                <img src={props.imgSrc} alt={props.imgAlt} />
                <p id={s.project_title}>{props.name}</p>
                <span id={s.cart_description}>{props.description}</span>
                <br />
                <button id={s.wisit_button}>Visit Website</button>
            </div>
    );
}

export default BigProjectCart;
